// src/components/Curriculum.js
import React, { useState } from 'react';
import { Card, ListGroup, Form, Button } from 'react-bootstrap';

function Curriculo() {
  const [nome, setNome] = useState("O Sábio Senhor das Galáxias");
  const [telefone, setTelefone] = useState("(12) 9 1234-5678");
  const [endereco, setEndereco] = useState("Rua da Saudade, nº 123, Bairro do Sorriso, CEP, Cidade da Luz-PE");

  const [formacao, setFormacao] = useState({
    graduacao: "2019 – CIÊNCIA DA COMPUTAÇÃO – TreinaRec",
    posGraduacao: [
      "2023 – Banco de dados – Mestrado – TreinaRec",
      "2024 – Spring API – Especialista – TreinaRec"
    ],
    tecnico: "2012 – Eletrônica Básica – IFPE"
  });

  const [selectedFormacao, setSelectedFormacao] = useState(''); // Para armazenar o tipo de formação selecionado

  // Função para selecionar o tipo de formação
  const handleSelectFormacao = (e) => {
    setSelectedFormacao(e.target.value);
  };

  const [experiencia, setExperiencia] = useState([
    "04/2024 a atual – Criador de bugs",
    "01/2023 a 03/2024 – Desenvolvedor",
    "01/2022 a 12/2022 – Testador de software"
  ]);

  const [informacoesAdicionais, setInformacoesAdicionais] = useState({
    facebook: "https://facebook.com/eu",
    linkedin: "https://linkedin.com/in/eu"
  });

  return (
    <div className="mt-5 pt-5">
      <Card>
        <Card.Header as="h5">IDENTIFICAÇÃO</Card.Header>
        <ListGroup variant="flush">
          <ListGroup.Item><strong>Nome:</strong> {nome}</ListGroup.Item>
          <ListGroup.Item><strong>Telefone:</strong> {telefone} [ ] WhatsApp</ListGroup.Item>
          <ListGroup.Item><strong>Endereço:</strong> {endereco}</ListGroup.Item>
        </ListGroup>
      </Card>

      <Card className="mt-3">
        <Card.Header as="h5">FORMAÇÃO</Card.Header>
        <ListGroup variant="flush">
          <ListGroup.Item><strong>Graduação:</strong> {formacao.graduacao}</ListGroup.Item>
          <ListGroup.Item><strong>Pós-Graduação:</strong> {formacao.posGraduacao.join(", ")}</ListGroup.Item>
          <ListGroup.Item><strong>Técnico:</strong> {formacao.tecnico}</ListGroup.Item>
        </ListGroup>
      </Card>

      <Card className="mt-3">
        <Card.Header as="h5">EXPERIÊNCIA</Card.Header>
        <ListGroup variant="flush">
          {experiencia.map((exp, index) => (
            <ListGroup.Item key={index}>{exp}</ListGroup.Item>
          ))}
        </ListGroup>
      </Card>

      <Card className="mt-3">
        <Card.Header as="h5">INFORMAÇÕES ADICIONAIS</Card.Header>
        <ListGroup variant="flush">
          <ListGroup.Item><strong>Facebook:</strong> <a href={informacoesAdicionais.facebook} target="_blank" rel="noopener noreferrer">{informacoesAdicionais.facebook}</a></ListGroup.Item>
          <ListGroup.Item><strong>LinkedIn:</strong> <a href={informacoesAdicionais.linkedin} target="_blank" rel="noopener noreferrer">{informacoesAdicionais.linkedin}</a></ListGroup.Item>
        </ListGroup>
      </Card>

      <div className="mt-3">
        <Button variant="primary" onClick={() => alert('Funcionalidade de editar currículo!')}>
          Editar Currículo
        </Button>
      </div>
    </div>
  );
}

export default Curriculo;
